import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import InputRange from 'react-input-range';

function App() {
  return (
    <div>
      <InputRange
        maxValue={20}
        minValue={0}
        value = {10}
      />
    </div>
  );
}

export default App;
